// SPDX-License-Identifier: MIT

pragma solidity ^0.8.7;

import "./Ownable.sol";

import "./priceFeed.sol";

contract crowdfunding is Ownable,price{

    struct fundDetails{
        address wallet;
        uint amount;
    }
    fundDetails[] detail;

    // 1 dollar needs to be send

    function sendFund() public payable{
        uint amount = uint(getLatestPrice());
        detail.push(fundDetails(msg.sender,msg.value));
    }

    function withdraw() public onlyOwner{
        payable(owner()).transfer(address(this).balance); 
        delete detail;
    }
    fallback() external payable{
        detail.push(fundDetails(msg.sender,msg.value));
    } 

    receive() external payable{
        detail.push(fundDetails(msg.sender,msg.value));
    }

    function listOfDonors() public view returns(fundDetails[] memory){
        return detail;
    }
    
}
